import React from 'react';
import { Link } from 'react-router-dom';

function ProjectsSection() {
  const projects = [
    { id: '01', name: 'Otava Learning', image: 'path_to_image1.jpg' },
    { id: '02', name: 'City of Helsinki', image: 'path_to_image2.jpg' },
    { id: '03', name: 'Fira', image: 'path_to_image3.jpg' },
    { id: '04', name: 'Vaisala DCX', image: 'path_to_image4.jpg' },
  ];

  return (
    <section className="projects">
      <h2>Highlighted projects</h2>
      <div className="project-grid">
        {projects.map((project) => (
          <div key={project.id} className="project-item">
            <img src={project.image} alt={project.name} />
            <h3>{project.id} {project.name}</h3>
          </div>
        ))}
      </div>
      <Link to="/work" className="see-all">See all â€º</Link>
    </section>
  );
}

export default ProjectsSection;
